import React, { useState } from 'react';

export default function PageAccueil() {
  const [time, setTime] = useState(5);
  setInterval(() => {
    setTime(time+1);
    console.log(time);
  }, 1000);
  return (
    <div>
        {time}
    </div>
  )
}
